  \"SiC-SiC and C-SiC Honeycomb for Advanced Flight Structures Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 46,\n\t\t\"recent\": 3\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-06T21:07:05.955333\",\n\t\"name\": \"sic-sic-and-c-sic-honeycomb-for-advanced-flight-structures-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The proposed project builds upon the work
  done in Phase I with the development of a C-SiC CMC honeycomb material that was
  successfully tested for mechanical properties at both ambient and high temperature.
  \ The further study expands to include the development of an SiC-SiC honeycomb using
  the proven infiltration process of the Phase I project.  In the proposed project,
  an SiC prepreg will be engineered that can be formed into a honeycomb and then infiltrated
  with SiC to form a ceramic SiC-SiC honeycomb.  The honeycomb will then be tested
  mechanically at ambient temperature and high temperature.  This testing will include
  cycling the material to determine property falloff.  C-SiC and SiC SiC will be compared
  in this study.  The thermal characteristics, such as conductivity and emissivity,
  will also be tested.  The integration of such a material into hypersonic and other
  structures is a key area of the research; therefore a bonding study is included
  in the current proposal.  Several bonding technologies and processes will be investigated
  and tested mechanically as well as cycled to determine durability.  The goal of
  the study is to provide a sandwich level technology that can be integrated into
  hypersonic vehicle structures and acreage.\",\n\t\"license_title\": \"U.S. Government
